import React, { Component } from "react";
import { connect } from "react-redux";
import logo from "../../assets/images/logo.png";
import {
  NavbarStyle,
  LogoContainer
} from "../../assets/components/layout/Navbar.style";

class Navbar extends Component {
  render() {
    return (
      <NavbarStyle>
        <LogoContainer>
          <img
            src={logo}
            className="brand-logo img-responsive"
            alt="simple dashboard logo"
          />
          <span className="brand-name">Simple</span>
        </LogoContainer>
      </NavbarStyle>
    );
  }
}

const mapStateToProps = state => {
  return {};
};

export default connect(
  mapStateToProps,
  null
)(Navbar);
